import React from "react";
import "./Buttons.css";
import { Link } from "react-router-dom";

const STYLES = ["btn--primary", "btn--outline"];
const SIZE = ["btn--medium", "btn--large"];

const Button = ({ 
    children, 
    type, 
    onClick, 
    buttonStyle, 
    buttonSize, 
    to, 
    buttonType
}) => {
  const buttonStyles = STYLES.includes(buttonStyle) ? buttonStyle : STYLES[0];
  const buttonsSize = SIZE.includes(buttonSize) ? buttonSize : SIZE[0];

  return (
    <Link to={to} className="btn-mobile">
      <button
        className={`btn ${buttonStyles} ${buttonsSize} ${buttonType}`} 
        onClick={onClick}
        type={type}>
        {children}
      </button>
    </Link>
  );
};

const Buttons = () => {
    return (
      <div className="btn-container">
        <Button linkTo="/sign-up" buttonStyle="btn--outline">Sign Up</Button>
        <Button linkTo="/login" buttonStyle="btn--primary">Login</Button>
      </div>
    );
  };

export default Buttons;
